import { Router } from "@reach/router";
import SignIn from "./SignIn";
import SignUp from "./SignUp";

function Application() {
  const user = null;
  <Router>
    <SignUp path="signUp" />
    <SignIn path="/" />
  </Router>;
}
export default Application;
